import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getItems, addToCart } from '../services/api';
import './ItemsList.css';

function ItemsList() {
  const [items, setItems] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    loadItems();
  }, []);

  const loadItems = async () => {
    try {
      const data = await getItems();
      setItems(data);
    } catch (error) {
      console.error('Error loading items:', error);
    }
  };

  const handleProductAction = (action, itemId = null) => {
    const isAuthenticated = localStorage.getItem('token');

    if (!isAuthenticated) {
      localStorage.setItem('redirectPath', window.location.pathname);
      navigate('/login');
      return;
    }

    if (action === 'addToCart' && itemId) {
      handleAddToCart(itemId);
    } else if (action === 'viewDetails') {
      // Handle viewing product details
    }
  };

  const handleAddToCart = async (itemId) => {
    try {
      await addToCart(itemId);
      alert('Item added to cart!');
    } catch (error) {
      console.error('Error adding to cart:', error);
    }
  };

  return (
    <div className="items-container">
      <div className="hero-section">
        <div className="hero-content">
          <span className="subtitle">Music is Classic</span>
          <h1 className="title">Sequoia Inspiring Musico.</h1>
          <div className="feature">
            <span className="feature-number">01</span>
            <div className="feature-content">
              <h3>Clear Sounds</h3>
              <p>Making your dream music come true stay with Sequoia Sounds!</p>
            </div>
          </div>
          <button 
            className="view-all-btn"
            onClick={() => handleProductAction('viewDetails')}
          >
            View All Products
          </button>
        </div>
        <div className="hero-image">
          <img src="/images/headphones-blue.png" alt="Blue Headphones" className="main-product-image" />
        </div>
      </div>

      <div className="products-grid">
        <div className="product-card featured">
          <h3>New Gen</h3>
          <h2>X-Bud</h2>
          <p>Premium Wireless Earbuds</p>
          <img src="/images/xbud-image.png" alt="X-Bud" />
          <button 
            className="view-more"
            onClick={() => handleProductAction('addToCart', 1)}
          >
            →
          </button>
        </div>

        <div className="product-card">
          <h3>Pro Series</h3>
          <h2>Studio Max</h2>
          <p>Professional Studio Headphones</p>
          <img src="/images/studio-max.png" alt="Studio Max Headphones" />
          <button 
            className="view-more"
            onClick={() => handleProductAction('addToCart', 2)}
          >
            →
          </button>
        </div>

        <div className="product-card">
          <h3>Light Grey Surface</h3>
          <h2>Headphone</h2>
          <p>Boosted with bass</p>
          <img src="/images/headphone-grey.png" alt="Grey Headphone" />
          <button 
            className="view-more"
            onClick={() => handleProductAction('addToCart', 3)}
          >
            →
          </button>
        </div>
      </div>

      <div className="social-links">
        <p>Follow us on:</p>
        <div className="social-icons">
          <a href="#twitter"><i className="fab fa-twitter"></i></a>
          <a href="#tiktok"><i className="fab fa-tiktok"></i></a>
          <a href="#instagram"><i className="fab fa-instagram"></i></a>
          <a href="#linkedin"><i className="fab fa-linkedin"></i></a>
        </div>
      </div>
    </div>
  );
}

export default ItemsList;
